<script>
import { ref } from "vue";
import { axiosInstance } from "../axios-config";
import { WaveFile } from "wavefile";

// Reactive state
const isRecording = ref(false);
const mediaRecorder = ref(null);
const audioChunks = ref([]);
const audioUrl = ref(null);
const recordingData = ref(null);

export default {
  data() {
    return {
      isDioActive: false,
      isStartActive: false,
      isHideAll: false,
      isShowNewItems: false,
      bea: 0,
    };
  },
  methods: {
    handleClick() {
      console.log('Button clicked!');
      this.isDioActive = false;
      this.isStartActive = false;
      this.isHideAll = false;
      this.isShowNewItems = false;
      this.bea = 0;
      window.location.reload();
    },
    async activateDio() {
      console.log("Activating Dio");
      this.isDioActive = true;
      this.isStartActive = true;
      await this.startRecording();
    },
    deactivateTarget() {
      this.isDioActive = false;
      if (mediaRecorder.value) {
        mediaRecorder.value.stop();
      }
      this.isHideAll = true;
      this.isShowNewItems = true;
    },
    async startRecording() {
      isRecording.value = true;
      audioChunks.value = [];

      const stream = await navigator.mediaDevices.getUserMedia({ audio: true });
      mediaRecorder.value = new MediaRecorder(stream, {
        mimeType: "audio/webm",
      });
      console.log("helllllllllllll");
      mediaRecorder.value.ondataavailable = (event) => {
        audioChunks.value.push(event.data);
        console.log("Audio chunk available:", event.data);
      };

      mediaRecorder.value.onstop = async () => {
        console.log("Recording stopped, audio chunks:", audioChunks.value);
        await this.saveRecording();
        stream.getTracks().forEach(track => track.stop());
      };

      mediaRecorder.value.start();
    },
    async saveRecording() {
      if (audioChunks.value.length === 0) {
        console.error("No audio chunks recorded.");
        return;
      }

      const webmBlob = new Blob(audioChunks.value, { type: "audio/webm" });
      // Read the Blob as an ArrayBuffer
      const arrayBuffer = await webmBlob.arrayBuffer();

      // Decode the WebM audio data to PCM
      const audioContext = new (window.AudioContext ||
        window.webkitAudioContext)();
      const audioBuffer = await audioContext.decodeAudioData(arrayBuffer);

      // Convert PCM to WAV using WaveFile
      const wav = new WaveFile();
      wav.fromScratch(
        1,
        audioBuffer.sampleRate,
        "16",
        audioBuffer.getChannelData(0)
      );

      // Create a new Blob from the WAV data
      const wavBlob = new Blob([wav.toBuffer()], { type: "audio/wav" });

      console.log("WAV Blob created:", wavBlob);
      // Create a FormData object and append the WAV Blob
      const formData = new FormData();
      formData.append("file", wavBlob, "recording.wav");

      try {
        const response = await axiosInstance.post(
          "http://localhost:8000/process-data",
          formData,
          {
            headers: {
              "Content-Type": "multipart/form-data",
            },
          }
        );
        recordingData.value = response.data;
        console.log("hello you there wher am i");
        console.log(recordingData.value.average_db);
        this.bea = Math.floor(recordingData.value.average_db);
        
        audioUrl.value = recordingData.value.audioUrl; // Assuming the server returns the URL of the saved audio file
      } catch (error) {
        console.error(error);
      }
      isRecording.value = false;
      audioChunks.value = [];
    },
  },
  // computed: {
  //   colorClass() {
